-- 导出  函数 app._nextval 结构
DELIMITER //
CREATE DEFINER=`root`@`%` FUNCTION `_nextval`(n varchar(50)) RETURNS varchar(50) CHARSET utf8
begin  
declare _cur varchar(50);  
declare s_format varchar(50); 
declare _pre varchar(50); 
declare s_increment integer; 
select current_value,pre,_format,_increment into _cur,_pre,s_format,s_increment from tb_sequence where name= n;
select CONCAT(_pre,LPAD(CONVERT(right(_cur,length(s_format)),SIGNED)+s_increment,length(s_format),'0')) into _cur from dual;
update tb_sequence  
 set current_value = _cur 
 where name=n ;  
return _cur;  
end//
DELIMITER ;


-- 导出  函数 app._nextval_by_orgid 结构
DELIMITER //
CREATE DEFINER=`root`@`%` FUNCTION `_nextval_by_orgid`(_name varchar(50),_org_id varchar(50)) RETURNS varchar(50) CHARSET utf8
begin  
declare _cur varchar(50);  
declare s_format varchar(50); 
declare _pre varchar(50); 
declare s_increment integer; 
select current_value,pre,_format,_increment into _cur,_pre,s_format,s_increment from tb_sequence where name= _name and org_id=_org_id;
select CONCAT(_pre,LPAD(CONVERT(right(_cur,length(s_format)),SIGNED)+s_increment,length(s_format),'0')) into _cur from dual;
update tb_sequence  
 set current_value = _cur 
 where name=_name and org_id=_org_id;  
return _cur;  
end//
DELIMITER ;
